import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  let clicked = false
  const btnClickHandler = () => { 
    alert("Button clicked") 
    clicked = true
  }
  return (
    <div className="App">
      <div className="App-wrapper">
        <button className="App-login-btn" onClick = {btnClickHandler}>Log In</button>
      </div>
    </div>
  );
}

export default App;
